  false,\n\t\"url\": null,\n\t\"notes\": \"Wind wave spectra and meteorological data
  were collected from FIXEDnPLATFORMS in the East/West coasts of US, North Pacific
  Ocean, Gulf ofnMexico, Gulf of Alaska, Great Lakes, and other locations. Data werencollected
  from buoys with surface and subsurface sensors from 01 Mayn2002 to 31 May 2002.
  Data were supplied by the National Data Buoy Centern(NODC) as a F291 file type.nnStation
  identifier, position, date, time, sampling duration and samplingnrate are reported
  for each series of measurements. Reportednmeteorological parameters may include
  air temperature and pressure, dewnpoint, wind speed and direction, wind gust, visibility,
  precipitationnand solar radiation. Ocean surface data may include water temperaturenand
  salinity (or conductivity), significant wave height and steepness.nSubsurface temperature,
  salinity, conductivity, pressure, and east andnnorth current components may also
  be reported. Wave data may be reportednas spectral density values or (for directional
  spectra) as co- andnquad-spectra or angular Fourier coefficients.\",\n\t\"owner_org\":
